    <script>
     let outpute = function number(arr,num) { 
         let res = arr[0];
          for(let i = 1;i<num;i++) {
               res = res ^ arr[i] 
            } 
               return res
             }
                let arr = [6,6,5,5,1,3,3,2,2];
                 let num = arr.length;
                  let x = outpute(arr,num);
                   if(x==0){
                        document.write("null");
                     } 
                     else{
                          document.write(x); 
                        } 
     </script>
